import React from 'react';
import yashan from '../src/image/yashan.jpeg';

const AboutUs = () =>{
    return (
        <>
        <div className="container emp-profile">
        <form method="">
            <div className="row">
                <div className="col-md-4">
                <img src={yashan} alt="yashanpic"/>
                </div>
            </div>
        </form>
        </div>

        </>
    );
}
export default AboutUs;
